const searchResults = [];
page.backupapplicationsDatasource.forEach(row => {
    if (row.title.toLowerCase().includes(page.searchValue) || row.surname.toLowerCase().includes(page.searchValue)) {
        searchResults.push(row)
    } else if (row.email.toLowerCase().includes(page.searchValue.toString())) {
        searchResults.push(row);
    } else if (row.status.toLowerCase().includes(page.searchValue.toString())) {
        searchResults.push(row);
    }
    // To add for date
})
page.applicationsDatasource = searchResults;

// Exclude admin account
page.result = page.result.filter((account) => account.email !== 'admin@gmail.com');
page.applicationsDatasource = page.result.reverse();
page.backupapplicationsDatasource = page.applicationsDatasource;
page.totalApplications = page.applicationsDatasource.length;
page.notificationsApplications = page.result.filter(application => application.status === 'Pending').length

let unique:any = new Date().getTime().toString();
unique = unique.split('');
page.tempPassword = `${unique[unique.length - 1]}${unique[unique.length - 2]}${unique[unique.length - 3]}${unique[unique.length - 4]}`;

// Determine all unread
page.notificationsCount = 0;
page.result.forEach((notification) => {
    if(!notification.read){
        page.notificationsCount++;
    }
})

bh.startIndex = page.currentPageIndex * bh.input.itemsPerPage;
bh.endIndex = bh.startIndex + bh.input.itemsPerPage;
page.applicationsDatasource = page.backupapplicationsDatasource.slice(bh.startIndex, bh.endIndex);

